import styled from "styled-components";

export const FooterContainer = styled.div`
    display: flex;
    flex-direction: column;
    border: blue solid 1px;

    div:nth-child(3){
        border: green solid 1px;
        display: flex;
        
    }
`

export const Mensagem = styled.div`
    border: red solid 1px;
    padding: 8px;
    width: 40%;

    
`
